class TpBeingmaintainedComponent extends TiBaseComponent {
    constructor(elementRef, renderer2, changeDetector) {
        super(elementRef, renderer2);
        this.elementRef = elementRef;
        this.renderer2 = renderer2;
        this.changeDetector = changeDetector;
        this.tpBeingmaintained = TiLocale.getLocaleWords().tpBeingmaintained;
    }
    ngOnInit() {
        super.ngOnInit();
        this.setRegionsData();
    }
    ngOnDestroy() {
        super.ngOnDestroy();
        if (this.regionsDataSub) {
            this.regionsDataSub.unsubscribe();
        }
    }
    setRegionsData() {
        if (!window.cfRegionSubject) {
            return;
        }
        this.regionsDataSub = window.cfRegionSubject.subscribe({
            next: (items) => {
                if (items.region && items.region.displayName) {
                    const displayName = `<span>${items.region.displayName}</span>`;
                    this.label = Util.formatEntry(this.tpBeingmaintained.label, [displayName]);
                    this.getMaintainData().then((maintainData) => {
                        if (maintainData) {
                            if (!Util.isEmptyString(maintainData.time)) {
                                this.maintainTime = `${this.tpBeingmaintained.maintainTime}${maintainData.time}`;
                            }
                            this.describe = maintainData.describe;
                        }
                    });
                }
                this.maintainRegions = items.maintainRegions;
                this.changeDetector.detectChanges();
            }
        });
    }
    getMaintainData() {
        return AccountService.queryCustomMaintenances().then((data) => {
            let time = '';
            let describe = '';
            if (data) {
                time = data.startTime + ' - ' + data.endTime;
                describe = data.describe;
            }
            return { time, describe };
        });
    }
}
