class TpPurchaselistComponent extends TiBaseComponent {
    constructor() {
        super(...arguments);
        /**
         * 是否存在一键清空功能
         */
        this.enableClear = true;
        /**
         * 费用总金额
         */
        this.totalPrice = 0;
        /**
         * 优惠金额
         */
        this.discountPrice = 0;
        /**
         * 用户可根据实际场景决定确认按钮是否禁用（比如未实名认证等）
         *
         * 10.1.1新增接口
         */
        this.buttonDisabled = true;
        /**
         * 采购产品数量统计
         */
        this.total = 0;
        /**
         * 订单确认按钮点击事件
         */
        this.confirm = new EventEmitter();
        /**
         * 头部一键清空按钮点击事件
         */
        this.clear = new EventEmitter();
        /**
         * 可选优惠项切换选择项时触发
         *
         * 10.1.2 新增接口
         */
        this.discountChange = new EventEmitter();
        /**
         * @ignore
         */
        this.emptyText = '--';
        /**
         * @ignore
         * 协议是否勾选
         */
        this.checked = false;
    }
    /**
     * @ignore
     */
    discountsChange($event) {
        this.discountChange.emit($event);
    }
    onCheckboxNgModelChange(model) {
        // Todo 禁用tip
    }
    /**
     * @ignore
     * 确认按钮点击触发
     */
    clickFn() {
        this.confirm.emit();
    }
    /**
     * @ignore
     * 一键清空
     */
    clearFn() {
        this.clear.emit();
    }
}
